import React from "react";
import {Container, Navbar, NavbarBrand} from "react-bootstrap"

export function TopNav(){
    return(
        <Container fluid>
            <Navbar bg="dark">
                <Navbar.Brand>
                    <img
                        alt="Xepelin logo"
                        src="./img/logo.svg"
                    />
                </Navbar.Brand>
            </Navbar>
        </Container>
    )
}
